import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import home from "./pages/home";

function App() {
  console.log("hello");
  return (
    <Router>
      <Route exact path="/home" component={home} />
    </Router>
  );
}

export default App;
